import React, { Component } from 'react';
import './Obruc.css';
import leftovers from '../assets/art/srce.jpg';
import ArtDisplay from '../Components/ArtDisplay';

const Text = <span>
              Leftovers
            </span>

class Leftovers extends Component {

  render() {
    return(
      <ArtDisplay title='Crow &amp; Poppies' client='Personal work' year='2018' technique='Mixed media' text={Text}>
        <img className="block-image mx-auto" src={leftovers} alt=""></img>
      </ArtDisplay>
    );
  }
}

export default Leftovers;
